%spark
// Generate a test dataset and save to cPouta for future runs (skip if already in swift)
import scala.util.Random
val randomDNA = sc.parallelize(1 to math.pow(10,3).toInt, 128).flatMap { _ =>
    val rnd = new Random
    (1 to math.pow(10,5).toInt).map { _ =>
        (1 to math.pow(10,3).toInt).map { _ =>
            Seq("A","T","G","C")(rnd.nextInt(4))
        }.reduce(_+_)
    }
}.saveAsTextFile("swift://mare.cpouta/gc-count/random_dna_11")

%spark
// GC count with native Spark 
{
val gcCount = sc.textFile("hdfs://spark-marco-master-000/random_dna_11")
    .map(_.count(n => n == 'G' || n == 'C').toLong)
    .reduce(_+_)
println(gcCount)
}
